#include <fstream>
using namespace std;

ifstream fin("tort.in");
ofstream fout("tort.out");

int main() {
  int m, n;
  fin >> m >> n;
  int mn = min(m, n);
  int ans = 0;
  int l = 0;
  for (int i = mn; i >= 1; i--) {
    if (m % i == 0 && n % i == 0) {
      ans = m * n / (i * i);
      l = i;
      break;
    }
  }
  fout << ans << " " << l << "\n";
  return 0;
}
